import React from "react";

import styles from "./Hero.module.css";
import { getImageUrl } from "../../utils";

export const Hero = () => {
  return (
    <section className={styles.container}>
      

      <div className={styles.content}>

      <div className="introContent">
            <span className="hello">Hello,</span>
            <span className="introText">I'm <span className="introName">Chandaan Balakrishna</span> <br />Software Developer</span>
            <p className="introPara">I am a Skilled Software Developer with experience in creating Applications</p>
        </div>
        <h1 className={styles.title}>Hi, I'm Chandaan Balakrishna</h1>
        <p className={styles.description}>
          I'm a full-stack developer with 5 years of experience using React and
          NodeJS. Reach out if you'd like to learn more!
        </p>
        <a href="mailto:myemail@email.com" className={styles.contactBtn}>
          Contact Me
        </a>
      </div>
      <img
        src={getImageUrl("hero/heroImage.png")}
        alt="Hero image of me"
        className={styles.heroImg}
      />
      <div className={styles.topBlur} />
      <div className={styles.bottomBlur} />
    </section>
  );
};
